// This function plots a line chart of 60 days of COVID infections
// msg.payload.covid19.dateReport[0]  // most recent date, counting backwards in time
// msg.payload.covid19.confirmed[0]
var COVIDdata = flow.get("COVIDdata");

msg.payload = COVIDdata[msg.row];

if( typeof(msg.payload.covid19) == 'undefined' ) {
  return null;    
}

var dateReport = new Date( msg.payload.covid19.dateReport[0] ).getTime() ;
// Calculate the first 7 day moving average

// The Array has this structure, inserting the first element as a template.
var ChartData = [ {"series":["New Cases","7 Day Moving Average"],
                   "data":[ [{"x":dateReport,"y":msg.payload.covid19.confirmed[0]-msg.payload.covid19.confirmed[1]}],
                            [{"x":dateReport,"y":0}]
                          ],
                   "labels":[""]}];

// Start at 1 because we've already added element 0 in the initial array definition
for( var i=1; i < msg.payload.covid19.dateReport.length; i++ ) {
    dateReport = new Date( msg.payload.covid19.dateReport[i] ).getTime() ;
    if( i != (msg.payload.covid19.dateReport.length-1) ) {
        ChartData[0].data[0].push( { "x":dateReport,"y":msg.payload.covid19.confirmed[i]-msg.payload.covid19.confirmed[i+1] } )
    }
}

// 7 Day Moving Average
var numOfDays = 6;
for( var j=0; j < (msg.payload.covid19.dateReport.length - numOfDays); j++ ) {
    dateReport = new Date( msg.payload.covid19.dateReport[j] ).getTime() ;

    var total = 0;
    for(var m = j; m < (j + numOfDays); m++) {
        total += ChartData[0].data[0][m].y;
    }
    ChartData[0].data[1].push( { "x":dateReport,"y": Math.round(total / numOfDays) } );
 }

// Sort on the time so that we give the Chart node an array in time order
ChartData[0].data[0].sort(function sortNumber(a,b) { return a.x - b.x; });
// Sort on the time so that we give the Chart node an array in time order
ChartData[0].data[1].sort(function sortNumber(a,b) { return a.x - b.x; });

msg.payload = ChartData;
return msg;

